import React from "react";
import { FaHome, FaFileAlt, FaAlignLeft } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="absolute z-10 w-screen h-[100px] bg-yellow flex justify-center">
      <div className="w-[80%]  items-center flex justify-center grid grid-cols-2">
        <div className="flex w-full h-full justify-start"></div>
        <div className="flex  w-full h-full justify-end items-center">
          <div className="w-[7%] flex justify-center">
            {" "}
            <FaHome size={40} className="cursor-pointer text-dark" />{" "}
          </div>
          <div className="w-[7%] flex justify-center">
            {" "}
            <FaAlignLeft size={40} className="cursor-pointer text-dark" />{" "}
          </div>
          <div className="w-[7%] flex justify-center">
            {" "}
            <FaFileAlt size={40} className="cursor-pointer text-dark" />{" "}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
